import styled from "styled-components";

export const Container=styled.div`
margin-top: 200px;
border: 1px solid red;
height: 400px;
`
export const Title=styled.div`
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 48px;
line-height: 130%;
text-align: center;
color: rgba(255, 255, 255, 0.9);
`
